var tipuesearch = {"pages": [{'title': 'About', 'text': '本學期的電腦輔助設計實習, 要求每一位學員根據本 HW template 的格式建立個人的作業倉儲與網頁. \n \n 40923203 \n 網站倉儲:  https://github.com/youshin40923203/cad2021_hw \n 網站連結:  https://youshin40923203.github.io/cad2021_hw/content/index.html \n 其他與作者或作業相關資料說明或介紹 \n CAD:Onshape、Slovespace \n', 'tags': '', 'url': 'About.html'}, {'title': 'TASK', 'text': '', 'tags': '', 'url': 'TASK.html'}, {'title': 'HWpages', 'text': 'CAD2021 2B\xa0 \xa0 \xa0 \xa0 \xa0 \n \n \n \n 學號 \n 網站 \n 倉儲 \n \n \n 40723126 \n 40723126 \n 40723126 \n \n \n 40723135 \n 40723135 \n 40723135 \n \n \n 40723217 \n 40723217 \n 40723217 \n \n \n 40732331 \n \xa0s40732331 \n s40732331 \n \n \n 40823114 \n 40823114 \n 40823114 \n \n \n 40823115 \n 40823115 \n 40823115 \n \n \n 40823117 \n pyc40823117 \n pyc40823117 \n \n \n 40823119 \n 40823119 \n 40823119 \n \n \n 40823122 \n 40823122 \n 40823122 \n \n \n 40823127 \n 40823127 \n 40823127 \n \n \n 40823146 \n 40823146 \n 40823146 \n \n \n 40823148 \n 40823148 \n 40823148 \n \n \n 40823215 \n 40823215 \n 40823215 \n \n \n 40871106 \n 40871106 \n 40871106 \n \n \n 40923201 \n 40923201 \n 40923201 \n \n \n 40923203 \n youshin40923203 \n youshin40923203 \n \n \n 40923204 \n 40923204 \n 40923204 \n \n \n 40923205 \n 40923205 \n 40923205 \n \n \n 40923206 \n 40923206-1 \n 40923206-1 \n \n \n 40923207 \n 40923207 \n 40923207 \n \n \n 40923208 \n \xa0nfu40923208 \n \xa0nfu40923208 \n \n \n 40923209 \n nfu40923209 \n nfu40923209 \n \n \n 40923210 \n 40923210 \n 40923210 \n \n \n 40923211 \n a40923211 \n a40923211 \n \n \n 40923212 \n \xa040923212 \n \xa040923212 \n \n \n 40923213 \n 40923213 \n 40923213 \n \n \n 40923214 \n 40923214 \n 40923214 \n \n \n 40923216 \n 40923216 \n 40923216 \n \n \n 40923217 \n 40923217 \n 40923217 \n \n \n 40923218 \n 40923218 \n 40923218 \n \n \n 40923219 \n nfu40923219 \n nfu40923219 \n \n \n 40923220 \n 40923220 \n 40923220 \n \n \n 40923221 \n 40923221 \n 40923221 \n \n \n 40923223 \n 40923223 \n 40923223 \n \n \n 40923224 \n s40923224 \n s40923224 \n \n \n 40923225 \n 40923225 \n 40923225 \n \n \n 40923226 \n 40923226 \n 40923226 \n \n \n 40923227 \n 40923227 \n 40923227 \n \n \n 40923228 \n 40923228 \n 40923228 \n \n \n 40923229 \n 40923229 \n 40923229 \n \n \n 40923230 \n 40923230 \n 40923230 \n \n \n 40923231 \n 40923231 \n 40923231 \n \n \n 40923232 \n 40923232 \n 40923232 \n \n \n 40923233 \n 40923233 \n 40923233 \n \n \n 40923234 \n 40923234 \n 40923234 \n \n \n 40923235 \n 40923235 \n 40923235 \n \n \n 40923236 \n 40923236 \n 40923236 \n \n \n 40923237 \n 40923237 \n 40923237 \n \n \n 40923238 \n 40923238 \n 40923238 \n \n \n 40923239 \n 40923239 \n 40923239 \n \n \n 40923240 \n 40923240 \n 40923240 \n \n \n 40923241 \n 40923241 \n 40923241 \n \n \n 40923242 \n 40923242 \n 40923242 \n \n \n 40923243 \n 40923243 \n 40923243 \n \n \n 40923244 \n 40923244 \n 40923244 \n \n \n 40923245 \n 40923245-1 \n 40923245-1 \n \n \n 40923246 \n 40923246 \n 40923246 \n \n \n 40923247 \n 40923247 \n 40923247 \n \n \n 40923248 \n 40923248 \n 40923248 \n \n \n 40923249 \n 40923249-1 \n 40923249-1 \n \n \n 40923250 \n 40923250 \n 40923250 \n \n \n 40923251 \n 40923251 \n 40923251 \n \n \n 40923252 \n 40923252 \n 40923252 \n \n \n 40923253 \n 40923253 \n 40923253 \n \n \n 40971220 \n 40971220 \n 40971220 \n \n \n 40971227 \n 40971227 \n 40971227 \n \n \n \n * 在表單複製全班的班級名單>利用表單複製下來的Github帳號>修改自己網站的網址進入他人網站>一個一個複製貼上完成名單的連結 \n (未填寫表單Github帳號的同學以學號代替) \n', 'tags': '', 'url': 'HWpages.html'}, {'title': 'HW1', 'text': 'HW1 佔學期成績 25% \n HW1 必須在 2021.11.10 22:00 之前完成. \n HW1 具體項目成果回報區 將於 2021.09.23 開啟, 於  2021.11.10 22:00 關閉. \n 作業一: meArm Robot 零件繪圖與機電運動模擬場景製作 \n Step1 : 下載  meARM.7z  這個包含尚未完成組立的 meArm Robot 場景與雷射切割零件組立手冊. \n meArm_75-0040_v1.pdf  則是另外一本組立參考手冊. \n Step2 : 從課程網頁中的  Compile CoppeliaSim 頁面 , 下載  coppeliaSim 4.1.0 官方版與 MSYS2 編譯版.7z  (檔案大小 412 MB, 解開壓縮後 1GB) 可攜套件. \n Step3 : 在 HW1 中, 要求每一位學員透過程式亂數分配 (兩班實際亂數分配結果以上課時點擊下列按鈕所得結果為準) 所使用的兩套參數式 CAD 套件, 從軟體發展緣起開始進行介紹,\xa0 經過教育版軟體套件檔案的取得, 下載安裝以及配置使用. 根據 Step1 中的零件尺寸, 逐一完成 meArm Robot 各零件繪製與組立. 並將零件 匯入  CoppeliaSim 進行組裝配置後, 以  UI 介面 中的 slider 控制 meArm Robot 各軸的旋轉作動. \n 2b CAD 套件分配結果:  https://mde.tw/cad2021/downloads/online/2b_hw1_cad.txt \n 附件: \n 1. CAD 套件分配表: \n sw: Solidworks, inv: Inventor, nx: NX12, ons: Onshape, slvs: Solvespace \n 2a 套件亂數分配結果 \n 2b 套件亂數分配結果 \n 2. 在兩套 CAD 完成零件繪圖並轉入 CoppeliaSim 後, 為了建立 Dynamic Model 必須利用  shape edit modes  轉為  clean model , 並與實際轉入的 STL 格式零件外形結合應用後建立模擬場景 (scenes). \n 3. meARM Robot  動態模擬場景 的建構, 可參考  0 ,  1 ,  2 ,  3 ,  4 ,  5 ,  6 ,  7 , 也可參考  Uarm Robot model  與相關 影片 . \n 4. CoppeliaSim design dynamic simulations  說明頁面 . \n 5.  網際 Lua  程式執行. \n 6.  meArm.slvs ,  meArm_in_solvespace.slvs \n 7. UI 介面程式參考: \n function closeEventHandler(h)\n    sim.addLog(sim.verbosity_scriptinfos,\'Window \'..h..\' is closing...\')\n    simUI.hide(h)\nend\n\nfunction joint1_rotate(ui,id,newVal)\n    simUI.setLabelText(ui,3000,\'theta1 set to \'..newVal)\n    sim.setJointTargetPosition(joint1, newVal*deg)\nend\n\nfunction joint2_rotate(ui,id,newVal)\n    simUI.setLabelText(ui,3000,\'theta2 set to \'..newVal)\n    sim.setJointTargetPosition(joint2, newVal*deg)\nend\n\nfunction joint3_rotate(ui,id,newVal)\n    simUI.setLabelText(ui,3000,\'theta3 set to \'..newVal)\n    sim.setJointTargetPosition(joint3, newVal*deg)\nend\n\nfunction joint16_rotate(ui,id,newVal)\n    simUI.setLabelText(ui,3000,\'theta16 set to \'..newVal)\n    sim.setJointTargetPosition(joint16, newVal*deg)\n    sim.setJointTargetPosition(joint20, -newVal*deg)\nend\n\nfunction sysCall_init()\n    -- do some initialization here\n    joint1 = sim.getObjectHandle(\'motor1\')\n    joint2 = sim.getObjectHandle(\'motor2\')\n    joint3 = sim.getObjectHandle(\'motor3\')\n    joint16 = sim.getObjectHandle(\'motor16\')\n    joint20 = sim.getObjectHandle(\'motor20\')\n    i = 0\n    deg = math.pi/180\n    print(i)\n    xml = [[\n<ui closeable="true" on-close="closeEventHandler" resizable="true">\n    <label text="This is a demo of the CustomUI plugin. Browse through the tabs below to explore all the widgets that can be created with the plugin." wordwrap="true" />\n    <tabs>\n        <tab title="Numeric">a\n            <label text="Sliders can be oriented horizontally or vertically, and have optional properties that can be set (in the XML) such as minimum and maximum value." wordwrap="true" />\n            <label text="" id="3000" wordwrap="true" />\n            <label text="theta1" /> <hslider tick-position="above" tick-interval="1" \n            minimum="0" maximum="360" on-change="joint1_rotate" />\n            <label text="theta2" /> <hslider tick-position="above" tick-interval="1" \n            minimum="-90" maximum="65" on-change="joint2_rotate" />\n            <label text="theta3" /> <hslider tick-position="above" tick-interval="1" \n            minimum="-90" maximum="185" on-change="joint3_rotate" />\n            <label text="theta16" /> <hslider tick-position="above" tick-interval="1" \n            minimum="0" maximum="15" on-change="joint16_rotate" />\n        </tab>\n    </tabs>\n</ui>\n]]\n    ui=simUI.create(xml)\n    \nend \n \n (From:  2016_ADDITIVE MANUFACTURING PROCESSES FOR FABRICATING A MINI ROBOT - COMPUTATIONAL MODELS AND EXPERIMENTAL RESULTS.pdf ) \n \n', 'tags': '', 'url': 'HW1.html'}, {'title': 'Onshape', 'text': 'About Onshape \n Onshape是由Solidworks的兩位創辦人於 2012年創建 的產品，它 是一種計算機輔助設計 (CAD) 軟件系統，通過軟件即服務 (SAAS)  模型通過  Internet  交付。廣泛使用雲計算，在基於互聯網的服務器上執行計算密集型處理和渲染，用戶可以通過網絡瀏覽器或 iOS 和 Android 應用程序與系統交互。 \n \n Onshape 升級直接發佈到Web 界面，該軟件不需要用戶進行維護工作。 \n \n Onshape  允許團隊在單個共享設計上進行協作，就像多個作者可以通過雲服務一起編輯共享文檔一樣。它主要專注於機械  CAD (MCAD) ，用於多個行業的產品和機械設計，包括消費電子、機械機械、醫療設備、 3D  打印、機器零件和工業設備。 \n \n \n (SaaS: 軟體即服務。透過網際網路連接並使用雲端式應用程式，例如:電子郵件、行事曆以及 Office 工具 (Microsoft Office 365)，這些通常是透過網頁瀏覽器進行，將資料儲存其中，可以在任何電腦或連接網際網路的裝置上，從網頁瀏覽器存取電子郵件與儲存的檔案資料。) \n \n \n \xa0如果說SolidWorks把握了從  DOS 到Windows平台轉變的機遇，那  Onshape 的目標就是把握從Windows平台轉移到雲端平台切換的機遇。20年来，SolidWorks一直是達所系統的增長引擎。通過此次併購，Onshape核心團隊成員加入PTC，也將扮演著類似的角色。 \n \n \n DOS:磁碟作業系統(Disk\xa0Operating\xa0Sy stem的縮寫)，是個人電腦上的一類作業系統。從1981年直到1995年的15年間，DOS在IBN PC相容機市場中佔有舉足輕重的地位。 \n \n \n \xa0 \xa0 \xa0 \xa0 \xa0  \n \n Onshape團隊CAD技術非常強大，Jon Hirschtick正是當年SolidWorks公司的創始人，Onshape另一創始人John McEleney也曾經長期擔任SolidWorks的CEO。 Jon Hirschtick 覺得台灣擁有龐大的工業製造基礎，因此提供跨全球的產品與服務，而Onshape提供的繁體中文操作介面，讓使用者能更加快速的理解，生產出更好的成果。 \n \n Onshape創始人兼 CEO Jon Hirschtick表示，“當今CAD系统的速度仍然不夠快、不夠簡便、不夠強大，而SaaS模式是跨越這些障礙最好的方式。”这也是Jon Hirschtick創立Onshape的初衷。 \n \n', 'tags': '', 'url': 'Onshape.html'}, {'title': 'History', 'text': '\n 2012年\xa0 \xa0 \n Onshape成立於 2012  年  11  月，前  SolidWorks  首席執行官  Jon Hirschtick  和  John McEleney  帶領六位聯合創始人推出了  Belmont Technology ，後來更名為  Onshape， 總部位於美國馬薩諸塞州劍橋市，是業内第一個SaaS產品開發平台的創造者，該平台將CAD與數據管理工具结合在一起。 \n \n 該公司的第一輪融資是來自 North Bridge Venture Partners 和 Commonwealth Capital 的 900 萬美元 \n \n \n \n \n \xa02015年 \n Onshape 2015年3月11日開放 CAD\xa0 軟件 公測版本， 經過與 \xa0 52 \xa0 個國家 / 地區的 \xa0 1000 \xa0 多名 \xa0 CAD \xa0 專業人士的預生產測試(包含在測試版中的是適用於 \xa0 iPhone \xa0 的 \xa0 Onshape) ， 同時宣布獲得了由North Bridge 和NEA 領投的6400萬美元的種子輪融資。 \n \n 種子輪融資又名天使輪融資，此融資可能就只有一個概念但什麼都沒開始，或者剛開始運營，還沒有出來產品，亦或是出來了產品卻沒有大規模開賣。這個時候誰投資，就像給種子澆水，始種子慢慢長大，但這項融資風險極高，誰給予投資誰就是一個天使。\xa0 \n \n 2015  年  8  月 該公司發布了其  Android  應用程序  Onshape 。 \n 2015  年  12  月\xa0 Onshape  推出了完整的商業版本。該公司還推出了  Onshape App Store ，提供  CAM 、模擬、描繪和其他可在雲端建立的工程工具。 \n \n Onshape App Store 與 24 個開發者合作夥伴一起推出。 \n \n \n 2016年 \n 2016年1月Onshape正式進行商業發布。目前，Onshape已經在全球超過150個國家應用了Onshape CAD，訪問者遍及全球各地。在發展過程中Onshape獲得過超過1.69億美元的投資，擁有  5000 多名全球用戶。 \n 2016  年  4  月\xa0 Onshape  推出了其教育計劃，為大學生和教育工作者提供免費版本的  Onshape Professional 。 \n 2016  年  5  月\xa0 Onshape  發布了  FeatureScript ，這是一種新的開源（ MIT  許可）編程語言，用於創建和自定義  CAD  功能。 \n \n 2016年和2018年 \n 2016年和2018年，e-works國際考察團曾兩次參訪 Onshape波士頓總部。 \n \n 2019年 \n 2019年10月23日Onshape同意被 PTC 收購，由PTC以4.7億美元收購，這是PTC第一個SaaS產品，也是全球第一個全雲端的3D整合型軟體，更為分散式團隊提供適合的3D CAD系統軟體。 \n \n \n \xa0(PTC是一家電腦軟體及服務公司，創立於1985年，總部設立於美國麻州波士頓市郊，於1988年率先開發參數固態電腦輔助設計模型軟體（CAD）並在1998年推出有關產品生命週期管理（PLM）Internet-based產品。PTC為合作夥伴及開發人員打造產品、服務及物聯網（IoT）與增廣實境（AR）平台。CAD、PLM、LOT和AR的技術組合，創建了數字世界和物理世界之間的閉環，以改變我們周圍一切事物的設計、製造和服務方式。此數字線程可以實現跨部門數據的連續性、促進跨職能的協作。) \n \n', 'tags': '', 'url': 'History.html'}, {'title': 'Onshape 安裝配置', 'text': '\n \xa0 NFU - MDE - cad2021 - 40923203 - Onshape套件下載安裝與配置影片: https://youtu.be/ZUUGDLaJcmQ \n 申請帳號網址: https://www.onshape.com/en/ \n \n', 'tags': '', 'url': 'Onshape 安裝配置.html'}, {'title': 'Onshape操作流程', 'text': 'NFU - MDE - cad2021 - 40923203 - Onshape零組件繪圖教學影片: https://youtu.be/D3OaaYg5y6U', 'tags': '', 'url': 'Onshape操作流程.html'}, {'title': 'Slovespace', 'text': 'About slovespace SolveSpace是一個免費和開源的2D 和3D CAD程序。它是一個基於約束的參數建模器，具有簡單的機械仿真功能。 2.1 及更高版本在 Windows、Linux 和 macOS 上運行（在 Linux 下也可作為snap 包安裝）。它由 Jonathan Westhues 和一個志願者社區開發。 \n \n 特點 \n \n 建模 3D 零件 – 使用拉伸、旋轉和 \xa0Boolean \xa0 (union / difference) 操作進行繪製 建模 2D 零件 – 將零件繪製為單個部分，並導出為DXF、PDF或SVG；使用 3D 裝配來驗證配合 準備CAM數據 – 為水刀機或激光切割機導出 2D 矢量藝術；或生成 STEP 或STL，用於導入第三方 CAM 軟件 機構設計 – 使用約束求解器模擬平面或空間鏈接，包括銷、球或滑動關節 平面和實體幾何 - 用實時尺寸繪圖替換手工求解的三角函數和電子表格 SolveSpace 是在GPL-3.0 或更高版本許可下分發的免費軟件。要打開的文件需要採用其自己的基於文本的 SolveSpace 模型 (*.slvs) 格式。 提供多種導出格式，包括 DXF、EPS、PDF、SVG、HPGL、STEP 等二維矢量繪圖；3D 線框作為 DXF 和 STEP；三角形網格作為 STL 和 Wavefront OBJ；和 NURBS 曲面作為 STEP。 \n 2013 年在Libre Graphics World 上發表了對開發人員的簡短評論和採訪。這篇評論讚揚了 SolveSpace 的小型可執行文件、高級約束求解器和輸出格式範圍。 \n 同一篇評論指出了一些缺點，主要是它對 NURBS 布爾值的緩慢和有限的處理以及缺乏原生 Linux 支持。但是，此後添加了本機 Linux 支持。 \n *3D CAD:計算機輔助設計 \n * \xa0Boolean: 構造實體幾何（CSG；以前稱為計算二元實體幾何）是一種用於實體建模的技術。構造實體幾何允許建模者通過使用布爾運算組合更簡單的對象來創建複雜的表面或對象，可能通過組合一些原始對象來生成視覺上複雜的對象 \n \n', 'tags': '', 'url': 'Slovespace.html'}, {'title': 'Slovespace 安裝配置', 'text': '\n 可攜系統開的時候就會一起打開', 'tags': '', 'url': 'Slovespace 安裝配置.html'}, {'title': 'Slovespace 操作流程', 'text': 'NFU - MDE - cad2021 - 40923203 - Slovespace零組件繪圖教學影片: https://youtu.be/6qJpm-N9wj4 \n', 'tags': '', 'url': 'Slovespace 操作流程.html'}, {'title': '運動場景', 'text': 'CAD1: \n CAD1 零件轉出後轉入 CoppeliaSim 操作影片 (Youtube) \n CAD1 零件轉入 CoppeliaSim 教學影片 (Wink) \n CAD1 轉入 Coppeliasim 教學影片 embedded 影片: 標題必須為「 NFU - MDE - cad2021 - 學號 - SW2020  零件轉入 CoppeliaSim 教學影片」且加上 語音說明 與 字幕. \n CAD2: \n CAD2 零件轉出後轉入 CoppeliaSim 操作影片 (Youtube) \n CAD2 零件轉入 CoppeliaSim 教學影片 (Wink) \n CAD2 轉入 Coppeliasim 教學影片 embedded 影片: 標題必須為「 NFU - MDE - cad2021 - 學號 - SW2020  零件轉入 CoppeliaSim 教學影片」且加上 語音說明 與 字幕. \n 若使用 Solidworks 2017 版, 則將 SW2020 換為 SW2017, 其他套件 INV2020 代表 AutoDesk Inventor 2020 版, 還有 Onshape 與 Solvespace 等套件名稱. \n', 'tags': '', 'url': '運動場景.html'}, {'title': 'H2', 'text': '', 'tags': '', 'url': 'H2.html'}, {'title': 'W13', 'text': '--------------- \n 繪圖進度(wink): \n \n \n \n \n   \n \n \n \n \n \n \n \n \n \n --------------- \n \n \n \n \n   \n \n \n \n \n \n \n \n \n \n --------------- \n \n \n \n \n   \n \n \n \n \n \n \n \n \n \n --------------- \n \n \n \n \n   \n \n \n \n \n \n \n \n \n \n --------------- \n \n \n \n \n   \n \n \n \n \n \n \n \n \n \n --------------- \n \n \n \n \n   \n \n \n \n \n \n \n \n \n \n ---------------', 'tags': '', 'url': 'W13.html'}, {'title': 'HW1-1', 'text': 'HW1-1 佔學期成績 15% \n HW1-1 必須在 2021.12.01 22:00 之前完成. \n HW1-1 具體項目成果回報區 將於 2021.11.18 開啟, 於  2021.12.01 22:00 關閉. \n 作業 1-1: Mirobot 機械手臂場景組合 \n 說明: meArm Robot 有四個自由度, 請根據 HW1 的零組件繪製組立與 CoppeliaSim 運動場景模擬, 延伸至  Task1-1  中六個自由度的 Mirobot 機械手臂. \n mirobot_part1_to_part5.7z  為取自 \xa0 https://github.com/wlkata/Mirobot-STL  的參考零件. 請利用場景中 Mirobot STL 零件, 組合為可以透過  UI 介面 中的 slider 控制各軸作動旋轉的運動模型. \n 請根據  Task1-1  中的說明, 完成各項指定任務. \n', 'tags': '', 'url': 'HW1-1.html'}, {'title': 'HW2', 'text': '', 'tags': '', 'url': 'HW2.html'}, {'title': 'w11', 'text': '零件尺寸圖&3D零件檔: \n https://drive.google.com/drive/u/1/folders/1nH0G0yf7soTB1Xxi0xDc_78IJjTgQoZi \n HW2 佔學期成績 20% \n HW2 必須在 2021.12.22 22:00 之前完成. \n HW2 具體項目成果回報區 將於 2021.12.09 開啟, 於  2021.12.22 22:00 關閉. \n meArm 逆向運動學與網際參數式 CAD API 結合應用. \n 請將  https://github.com/mdecourse/meArm  中的 meArm Robot 逆向運動學程式, 改為 Lua 與 Python 程式, 使能套用至 HW1 所完成的 CoppeliaSim meArm 運動模擬場景. 並分別採 Lua, Legacy remote API 及 Bluezero remote API 逆向運動的方式進行控制. \n 請利用  Task2  中的 Solidworks, Inventor 與 NX API 程式控制 meArm Robot 零組件尺寸, 說明並討論如何透過網際程式控制 meArm Robot 的零件尺寸, 並結合上述逆向運動學程式庫, 使得自動化機電產品開發流程更容易滿足客製化需求. \n 參考: \n 2016_ADDITIVE MANUFACTURING PROCESSES FOR FABRICATING A MINI ROBOT - COMPUTATIONAL MODELS AND EXPERIMENTAL RESULTS.pdf \n Robot Manipulator Control with Inverse Kinematics PD-Pseudoinverse Jacobian and Forward Kinematics Denavit Hartenber.pdf \n KINEMATIC ANALYSIS FOR ROBOT ARM.pdf \n https://codebender.cc/user/MeArm \n https://github.com/mdecourse/meArmPi \n /downloads/MeArmPiTechnicalOverviewV0-3DRAFT.pdf \n https://github.com/mdecourse/me-arm-ik \n https://github.com/mdecourse/mearm_model \n https://courses.ece.cornell.edu/ece5990/ECE5725_Fall2016_Projects/pas324_ml634/index.html \n https://github.com/mdecourse/InefficientSkittleSorter \n https://mearm.com \n', 'tags': '', 'url': 'w11.html'}, {'title': 'HW3', 'text': 'HW3 為選項作業. \n HW3 具體項目成果回報區 將於 2021.12.09 開啟, 於  2022.01.05 22:00 關閉 \n https://mde.tw/cad2021/content/Task3.html \xa0 \n https://mde.tw/cad2021/content/Task4.html \n https://mde.tw/cad2021/content/Task5.html \n https://mde.tw/cad2021/content/Task6.html \n https://mde.tw/cad2021/content/Task7.html \n 請從上列 Tasks 中自行選擇項目內容完成 HW3. \n', 'tags': '', 'url': 'HW3.html'}, {'title': 'Final Project', 'text': 'NFU - MDE - cad2021 - 40923203 -solidworks Final Project: https://youtu.be/XMYFgpwcLqo \n NFU-MDE-cad2021-40923203-對稱連桿繪製過程及組合: https://youtu.be/wRcqn5hKgYg', 'tags': '', 'url': 'Final Project.html'}, {'title': 'Vocabruary', 'text': '\n simulation\xa0 \xa0模擬 \n rendering\xa0 \xa0 描繪 \n cloud-based engineering tools 雲端工程工具 \n Information 資訊 \n \n', 'tags': '', 'url': 'Vocabruary.html'}, {'title': 'run', 'text': ' 導入 FileSaver 與 filereader  \n \n \n \n \n  導入 ace  \n \n \n \n \n \n \n  請注意, 這裡使用 Javascript 將 localStorage["py_src"] 中存在近端瀏覽器的程式碼, 由使用者決定存檔名稱 \n \n \n \n  印出版次與關鍵字程式  \n \n \n \n  用來顯示程式碼的 editor 區域  \n \n  以下的表單與按鈕與前面的 Javascript doSave 函式以及 FileSaver.min.js 互相配合  \n  存擋表單開始  Filename:  .py    存擋表單結束  \n \n  執行與清除按鈕開始  \n Run   Output   清除輸出區 清除繪圖區 Reload \n  執行與清除按鈕結束  \n \n  程式執行 ouput 區  \n \n  Brython 程式執行的結果, 都以 brython_div 作為切入位置  \n \n  導入 gearUtils-0.9.js Cango 齒輪繪圖程式庫  \n \n \n \n \n', 'tags': '', 'url': 'run.html'}]};